INSERT INTO `creature_text` (`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES
(186109, @GROUP_ID+0, @ID, 'You\'re no challenge!', 12, 0, 100, 0, 0, 0, 0, 0, 'Qalashi Necksnapper to Player'),
(186274, @GROUP_ID+0, @ID, 'Years of searching, and there it stands... my legacy.', 12, 0, 100, 0, 0, 204519, 0, 0, 'Wrathion to Player'),
(186274, @GROUP_ID+1, @ID, 'Once you\'ve finished your assessment, we\'ll begin the assault.', 12, 0, 100, 0, 0, 204520, 0, 0, 'Wrathion to Player'),
(186274, @GROUP_ID+2, @ID, 'I will consider your advice.', 12, 0, 100, 0, 0, 204511, 0, 0, 'Wrathion to Player'),
(186274, @GROUP_ID+3, @ID, 'I value your judgement $n. You are correct--our forces are few in number.', 12, 0, 100, 1, 0, 204521, 0, 0, 'Wrathion to Player'),
(186274, @GROUP_ID+4, @ID, 'But you forget... we also have myself. I am an incalculable advantage, and I will not be denied my legacy.', 12, 0, 100, 1, 0, 204522, 0, 0, 'Wrathion to Player'),
(186274, @GROUP_ID+5, @ID, 'Blacktalon! The moment we have prepared for is at hand--to the Obsidian Citadel!', 12, 0, 100, 5, 0, 204517, 0, 0, 'Wrathion to Player'),
(186274, @GROUP_ID+6, @ID, 'The djaradin will fall before us, and the Citadel will be ours!', 12, 0, 100, 457, 0, 204531, 0, 0, 'Wrathion to Player'),
(186493, @GROUP_ID+0, @ID, 'The forge lies nearby. We must work quickly, the area may not remain secure for long.', 12, 0, 100, 396, 0, 207360, 0, 0, 'Forgemaster Bazentus to Player'),
(186509, @GROUP_ID+0, @ID, 'I will crush you to embers!', 12, 0, 100, 36, 0, 207480, 0, 0, 'Modak Flamespit to Player'),
(186509, @GROUP_ID+1, @ID, 'My flame... flickers... on...', 12, 0, 100, 36, 0, 207478, 0, 0, 'Modak Flamespit to Blacktalon Assassin'),
(186511, @GROUP_ID+0, @ID, 'Choke on smoke and ash!', 12, 0, 100, 36, 0, 207479, 0, 0, 'Piercer Gigra to Player'),
(186511, @GROUP_ID+1, @ID, 'Your end comes... soon...', 12, 0, 100, 0, 0, 207488, 0, 0, 'Piercer Gigra to Player'),
(186592, @GROUP_ID+0, @ID, 'Your efforts will be buried under our advance!', 12, 0, 100, 36, 0, 207486, 0, 0, 'Champion Choruk to Blacktalon Avenger'),
(186592, @GROUP_ID+1, @ID, 'Come face me, weak one!', 12, 0, 100, 36, 0, 207485, 0, 0, 'Champion Choruk'),
(186892, @GROUP_ID+0, @ID, 'You\'re no dragon.', 12, 0, 100, 36, 0, 0, 0, 0, 'Qalashi Necksnapper to Player'),
(186933, @GROUP_ID+0, @ID, 'We have them on the run, $n. Now is our chance to strike a definitive blow!', 12, 0, 100, 0, 0, 204514, 0, 0, 'Wrathion to Player'),
(187042, @GROUP_ID+0, @ID, 'It seems only fitting that my flame secure my destiny!', 12, 0, 100, 0, 0, 204529, 0, 0, 'Wrathion to Player'),
(187042, @GROUP_ID+1, @ID, 'I will be denied no longer. Come, $n, let us finish the repairs.', 12, 0, 100, 1, 0, 204530, 0, 0, 'Wrathion to Player'),
(187045, @GROUP_ID+0, @ID, 'The Oathstone must be activated to restore the power of my dragonflight.', 12, 0, 100, 0, 0, 204475, 0, 0, 'Wrathion to Player'),
(187045, @GROUP_ID+1, @ID, 'Do not fail me, Bazentus.', 12, 0, 100, 0, 0, 204543, 0, 0, 'Wrathion to Player'),
(187119, @GROUP_ID+0, @ID, 'They dare strike at our home! Our queen!', 12, 0, 100, 53, 0, 203537, 0, 0, 'Commander Lethanak to Player'),
(187187, @GROUP_ID+0, @ID, 'Champion... it is an honor.', 12, 0, 100, 1, 0, 0, 0, 0, 'Blacktalon Avenger to Player'),
(187187, @GROUP_ID+1, @ID, 'It seems... I have room for improvement.', 12, 0, 100, 25, 0, 0, 0, 0, 'Blacktalon Avenger'),
(187187, @GROUP_ID+2, @ID, 'Perhaps you can learn a thing or two from me!', 12, 0, 100, 1, 0, 0, 0, 0, 'Blacktalon Avenger to Player'),
(187187, @GROUP_ID+3, @ID, 'I yield. You\'ve taught me much.', 12, 0, 100, 25, 0, 0, 0, 0, 'Blacktalon Avenger'),
(187187, @GROUP_ID+4, @ID, 'Don\'t hold back... I won\'t.', 12, 0, 100, 0, 0, 0, 0, 0, 'Blacktalon Avenger to Player'),
(187187, @GROUP_ID+5, @ID, 'The stories of your skill are not exaggerated.', 12, 0, 100, 432, 0, 0, 0, 0, 'Blacktalon Avenger to Player'),
(187189, @GROUP_ID+0, @ID, 'Champion... it is an honor.', 12, 0, 100, 659, 0, 0, 0, 0, 'Blacktalon Assassin to Player'),
(187189, @GROUP_ID+1, @ID, 'I want in this too!', 12, 0, 100, 659, 0, 0, 0, 0, 'Blacktalon Assassin to Blacktalon Assassin'),
(187189, @GROUP_ID+2, @ID, 'I yield. You\'ve taught me much.', 12, 0, 100, 1, 0, 0, 0, 0, 'Blacktalon Assassin'),
(187189, @GROUP_ID+3, @ID, 'The stories of your skill are not exaggerated.', 12, 0, 100, 659, 0, 0, 0, 0, 'Blacktalon Assassin'),
(187189, @GROUP_ID+4, @ID, 'I may be more than you can handle.', 12, 0, 100, 0, 0, 0, 0, 0, 'Blacktalon Assassin to Player'),
(187189, @GROUP_ID+5, @ID, 'Perhaps I\'ll best you... next time.', 12, 0, 100, 0, 0, 0, 0, 0, 'Blacktalon Assassin'),
(187189, @GROUP_ID+6, @ID, 'Don\'t hold back... I won\'t.', 12, 0, 100, 0, 0, 0, 0, 0, 'Blacktalon Assassin to Player'),
(187204, @GROUP_ID+0, @ID, 'The Titans... pollute you...', 12, 0, 100, 0, 0, 0, 0, 0, 'Grounded Primalist to Player'),
(187466, @GROUP_ID+0, @ID, 'It is an honor to be in the presence of such an esteemed ally of the Black Prince.', 12, 0, 100, 396, 0, 203576, 0, 0, 'Archivist Edress to Player'),
(187466, @GROUP_ID+1, @ID, 'The walls of the Obsidian Citadel have stood strong for thousands of years.', 12, 0, 100, 396, 0, 203579, 0, 0, 'Archivist Edress to Player'),
(187466, @GROUP_ID+2, @ID, 'With that kind of strength, there is no way the djaradin could have attacked it head on.', 12, 0, 100, 396, 0, 203575, 0, 0, 'Archivist Edress to Player'),
(187466, @GROUP_ID+3, @ID, 'I suspect the djaradin have instead used their elemental magic to crack the earth beneath the Citadel, entering from within Neltharus, the Obsidian fortress.', 12, 0, 100, 396, 0, 203574, 0, 0, 'Archivist Edress to Player'),
(187705, @GROUP_ID+0, @ID, 'It\'s a one-of-a-kind camera that I give to you, dear adventurer. Now you can follow in the footsteps of great catalogers--such as myself--that have blazed the trail before you.', 12, 0, 100, 1, 0, 0, 0, 0, 'Cataloger Wulferd to Player'),
(188447, @GROUP_ID+0, @ID, 'You cannot... stop us...', 12, 0, 100, 0, 0, 0, PLEASE_SET_A_BROADCASTTEXT_ID, 0, 'Jadzigeth to Darkglare'), -- BroadcastTextID: 168165 - 183241
