(189461, @GROUP_ID+0, @ID, 'Notify the others. $n has arrived.', 12, 0, 100, 396, 0, 0, 0, 0, 'Obsidian Watcher to Player'),
(189503, @GROUP_ID+0, @ID, 'Some of those crafted weapons have surely fallen into djaradin hands. They can be used against us!', 12, 0, 100, 1, 0, 204609, 0, 0, 'Scalecommander Emberthal to Player'),
(189503, @GROUP_ID+1, @ID, 'Fao is right--the plan is sound. But I fear we lack the forces to execute it successfully.', 12, 0, 100, 1, 0, 204607, 0, 0, 'Scalecommander Emberthal to Player'),
(189503, @GROUP_ID+2, @ID, 'If the walls of the citadel are built to withstand the djaradin, they\'ll surely prove a challenge for us as well. This will only aid the djaradin defending there.', 12, 0, 100, 1, 0, 204608, 0, 0, 'Scalecommander Emberthal to Player'),
(189503, @GROUP_ID+3, @ID, 'I believe I could be of some help to you. Let us review Wrathion\'s preparations for the assault.', 12, 0, 100, 1, 0, 204610, 0, 0, 'Scalecommander Emberthal to Player'),
(189503, @GROUP_ID+4, @ID, 'So many... we do not have the forces to break through those defenses!', 12, 0, 100, 1, 0, 204606, 0, 0, 'Scalecommander Emberthal to Player'),
(189507, @GROUP_ID+0, @ID, 'I heard rumors you were here.', 12, 0, 100, 396, 0, 206031, 0, 0, 'Talonstalker Kavia to Player'),
(189507, @GROUP_ID+1, @ID, 'It is best you see the size of their defensive force for yourself.', 12, 0, 100, 0, 0, 206030, 0, 0, 'Talonstalker Kavia to Player'),
(189610, @GROUP_ID+0, @ID, 'Strike for the knee!', 12, 0, 100, 0, 0, 0, 0, 0, 'Blacktalon Assassin to Qalashi Crustshaper'),
(189610, @GROUP_ID+1, @ID, 'This one is no match!', 12, 0, 100, 0, 0, 0, 0, 0, 'Blacktalon Assassin to Qalashi Crustshaper'),
(189734, @GROUP_ID+0, @ID, 'You can break me but not the mountains...', 12, 0, 100, 0, 0, 0, 0, 0, 'Qalashi Boltthrower to Player'),
(190208, @GROUP_ID+0, @ID, 'I forge my own destiny!', 12, 0, 100, 0, 0, 0, 0, 0, 'Rockslide Rider to Player'),
(191476, @GROUP_ID+0, @ID, 'This food is mine, but you\'ll be food next!', 12, 0, 100, 36, 0, 0, 0, 0, 'Searing Flame Harchek to Player'),
(191524, @GROUP_ID+0, @ID, 'Good fight!', 12, 0, 100, 0, 0, 0, 21254, 0, 'Qalashi Ironskin to Player'),
(191669, @GROUP_ID+0, @ID, 'Be swift, $n. I must claim the throne now!', 12, 0, 100, 5, 0, 204541, 0, 0, 'Wrathion to Player'),
(191895, @GROUP_ID+0, @ID, 'Our queen awaits!', 12, 0, 100, 1, 0, 205088, 0, 0, 'Majordomo Selistra to Player'),
(192795, @GROUP_ID+0, @ID, 'So much confidence... yet the numbers do not lie. I fear the worst.', 12, 0, 100, 0, 0, 204605, 0, 0, 'Scalecommander Emberthal to Player'),
(196995, @GROUP_ID+0, @ID, 'It\'s $n! The one everyone is talking about.', 12, 0, 100, 0, 0, 0, 0, 0, 'Talonstalker Gazi to Player'),
(197340, @GROUP_ID+0, @ID, 'Keep advancing, $n is with us!', 12, 0, 100, 53, 0, 0, 0, 0, 'Blacktalon Avenger to Player'),
(197341, @GROUP_ID+0, @ID, 'For the Black Prince!', 12, 0, 100, 0, 0, 0, 0, 0, 'Blacktalon Avenger to Player');
